import React from 'react';

import './table-item.css';


const TableItem = (props) => {

    const {name, height, mass, hair_color, eye_color} = props;

    return (

            <tr>
                <td>{name}</td>
                <td>{height}</td>
                <td>{mass}</td>
                <td>{hair_color}</td>
            </tr>

    );
}

export default TableItem;
